import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./components/Login";
import Register from "./components/Register";
import Forget from "./components/Forget";
import UserHome from "./components/UserHome";
import AppAdmin from "./components/AdminHome";
import HotelAdmin from "./components/HAdminHome";
import AddRestaurant from "./components/AddRestaurant"; // Assuming this is the correct path for AddRestaurant component

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
         <Route path="/register" element={<Register />} />
        <Route path="/forgot-password" element={<Forget />} />
        <Route path="/userhome" element={<UserHome/>}/>
        <Route path='/adminhome' element={<AppAdmin />} />
        <Route path="/hoteladmin" element={< HotelAdmin/>} />
        <Route path="/adminhome/addrestaurant" element={<AddRestaurant />} />

      </Routes>
    </Router>
  );
};

export default App;
